-- Procedure structure for EnquiryAccessLevel
-- ----------------------------
DROP PROCEDURE [dbo].[EnquiryAccessLevel]
GO



CREATE proc [dbo].[EnquiryAccessLevel]
@AccessLevelID int = null
, @AccessLevelName varchar(100) = null
as

select * from AccessLevel
Where (AccessLevelID = @AccessLevelID or @AccessLevelID is null)
		and (AccessLevelName like @AccessLevelName+'%' or @AccessLevelName is null)
		and (IsActived = 1)





