-- ----------------------------
-- Procedure structure for EnquiryHardware
-- ----------------------------
DROP PROCEDURE [dbo].[EnquiryHardware]
GO



CREATE proc [dbo].[EnquiryHardware]
@HardwareID int = null
, @HardwareTypeID int = null
, @HardwareCode varchar(50) = null
, @HardwareName varchar(200) = null
, @OfficeID int = null
, @OrganizationID int = null
, @HardwareTypeGroupID int = null
, @BeginDate datetime = null
, @EndDate datetime = null
as

select ha.*
		,hat.HardwareTypeName,ofe.OfficeName,ofe.OrganizationID,mt.MoneyTypeName,ac.AcquirementName  
		,HardwareTypeGroupID
from Hardware ha
inner join HardwareType hat on ha.HardwareTypeID = hat.HardwareTypeID
inner join Office ofe on ha.OfficeID = ofe.OfficeID
left join MoneyType mt on ha.MoneyTypeID = mt.MoneyTypeID 
left join Acquirement ac on ha.AcquirementID = ac.AcquirementID
Where (ha.HardwareID = @HardwareID or @HardwareID is null)
		and (ha.HardwareTypeID = @HardwareTypeID or @HardwareTypeID is null)
		and (ha.HardwareName like '%'+@HardwareName+'%' or @HardwareName is null)
		and (ha.HardwareCode like '%'+@HardwareCode+'%' or @HardwareCode is null)
		and (ha.OfficeID = @OfficeID or @OfficeID is null)
		and (ofe.OrganizationID = @OrganizationID or @OrganizationID is null)
		and (hat.HardwareTypeGroupID = @HardwareTypeGroupID or @HardwareTypeGroupID is null)
		and (ha.AcquirementDatetime >= @BeginDate or @BeginDate is null)
		and (ha.AcquirementDatetime <= @EndDate or @EndDate is null)


GO

-- ----------------------------
-- Procedure structure for EnquiryHardwareOfficeReport
-- ----------------------------
DROP PROCEDURE [dbo].[EnquiryHardwareOfficeReport]
GO

CREATE proc [dbo].[EnquiryHardwareOfficeReport]
@OrganizationID int = null
, @OfficeID int = null
, @HardwareTypeGroupID int = null
, @HardwareTypeID int = null
, @BeginDate datetime = null
, @EndDate datetime = null

as

Create Table #tmp(OfficeID int, OfficeName varchar(200), HardwareType int, Amount int, HardwareTypeCom int, AmountCom int, HardwareTypePhysician int, AmountPhysician int, Latitude varchar(200), Longitude varchar(200), URL varchar(200))
begin
	insert into #tmp(OfficeID, OfficeName, HardwareType, Amount, HardwareTypeCom, AmountCom, HardwareTypePhysician, AmountPhysician, Latitude, longitude, URL)
	select	ofe.OfficeID, ofe.OfficeName
			, Count(Distinct ha.HardwareTypeID) as HardwareType
			, Sum(ha.PriceSetID) as Amount
			, (Select Count(Distinct h.HardwareTypeID) from hardware h 
				inner join HardwareType ht on h.HardwareTypeID = ht.HardwareTypeID  
				inner join Office o on h.OfficeID = o.OfficeID
				where ht.HardwareTypeGroupID = 1 and o.OfficeID = ofe.OfficeID) as HardwareTypeCom
			, (Select Sum(h.PriceSetID) from hardware h 
				inner join HardwareType ht on h.HardwareTypeID = ht.HardwareTypeID  
				inner join Office o on h.OfficeID = o.OfficeID
				where ht.HardwareTypeGroupID = 1 and o.OfficeID = ofe.OfficeID) as AmountCom
			, (Select Count(Distinct h.HardwareTypeID) from hardware h 
				inner join HardwareType ht on h.HardwareTypeID = ht.HardwareTypeID  
				inner join Office o on h.OfficeID = o.OfficeID
				where ht.HardwareTypeGroupID = 2 and o.OfficeID = ofe.OfficeID) as HardwareTypePhysician
			, (Select Sum(h.PriceSetID) from hardware h 
				inner join HardwareType ht on h.HardwareTypeID = ht.HardwareTypeID  
				inner join Office o on h.OfficeID = o.OfficeID
				where ht.HardwareTypeGroupID = 2 and o.OfficeID = ofe.OfficeID) as AmountPhysician
			, ofe.Latitude , ofe.Longitude , ofe.URL
	from Hardware ha
			inner join Office ofe on ha.OfficeID = ofe.OfficeID
			inner join HardwareType hat on ha.HardwareTypeID = hat.HardwareTypeID  
	Where (ha.OfficeID = @OfficeID or @OfficeID is null)
		and (hat.HardwareTypeGroupID = @HardwareTypeGroupID or @HardwareTypeGroupID is null)
		and (ha.HardwareTypeID = @HardwareTypeID or @HardwareTypeID is null)
		and (ofe.OrganizationID = @OrganizationID or @OrganizationID is null)
		and (ha.AcquirementDatetime >= @BeginDate or @BeginDate is null)
		and (ha.AcquirementDatetime <= @EndDate or @EndDate is null)
	group by ofe.OfficeID, ofe.OfficeName, ofe.Latitude, ofe.Longitude, ofe.URL
end

select OfficeID, OfficeName, Sum(HardwareType) as HardwareType, sum(Amount) as Amount, Sum(HardwareTypeCom) as HardwareTypeCom, Sum(AmountCom) as AmountCom, Sum(HardwareTypePhysician) as HardwareTypePhysician, Sum(AmountPhysician) as AmountPhysician , Latitude as Latitude, Longitude as Longitude, URL
From #tmp
group by OfficeID, OfficeName, Latitude, Longitude, URL

drop table #tmp


GO

