CREATE proc [dbo].[EnquiryHardwareRequest]
@HardwareRequestID int = null
, @HardwareTypeID int = null
, @HardwareName varchar(100) = null
, @ModelCode varchar(100) = null
, @PriceSetID int = null
, @PriceSetMoney varchar(50) = null
, @OfficeID int = null
, @OrganizationID int = null
, @HardwareTypeGroupID int = null
, @BeginDate varchar(20) = null
, @EndDate varchar(20) = null
as

select har.*,hat.HardwareTypeName,hat.HardwareTypeGroupID 
		,ofe.OfficeName, ofe.OrganizationID 
from HardwareRequest har
left join HardwareType hat on har.HardwareTypeID = hat.HardwareTypeID 
inner join Office ofe on har.OfficeID = ofe.OfficeID
Where (har.HardwareRequestID = @HardwareRequestID or @HardwareRequestID is null)
		and (har.HardwareTypeID = @HardwareTypeID or @HardwareTypeID is null)
		and (har.HardwareName like '%'+@HardwareName+'%' or @HardwareName is null)
		and (har.ModelCode like '%'+@ModelCode+'%' or @ModelCode is null)
		and (har.OfficeID = @OfficeID or @OfficeID is null)
		and (har.PriceSetID = @PriceSetID or @PriceSetID is null)
		and (har.PriceSetMoney = @PriceSetMoney or @PriceSetMoney is null)
		and (har.HardwareRequestDatetime >= @BeginDate or @BeginDate is null)
		and (har.HardwareRequestDatetime <= @EndDate or @EndDate is null)
		and (ofe.OrganizationID = @OrganizationID or @OrganizationID is null)
		and (hat.HardwareTypeGroupID = @HardwareTypeGroupID or @HardwareTypeGroupID is null)



GO

