CREATE proc [dbo].[EnquiryUserForgotPassword]
	@Email varchar(100) = null
	, @UserName varchar(100) = null
as

select	top 1 UserName, dbo.DecryptPassword(Password) as Password, Email
from		users where UserStatusID <> 4 
			and (Email = @Email or @Email is null)
			and (UserName = @UserName or @UserName is null)
order by UserID desc





