-- ----------------------------
-- Procedure structure for gen_asp_sel
-- ----------------------------
DROP PROCEDURE [dbo].[gen_asp_sel]
GO




CREATE proc [dbo].[gen_asp_sel]
@name varchar(60)
as
declare @msg varchar(255)

declare @i int
declare @indid int
declare @col_cnt int
declare @ind_cnt int
declare @fldname varchar(60)

-- find index field
select @indid = min(indid)
  from sysindexes 
 where id = object_id(@name)
   and indid > 0 and indid < 255

create table #ind (name varchar(255) null)

select @i = 1
while @i <= 16
begin
    insert into #ind values( index_col(@name, @indid, @i) )
    select @i = @i + 1
end

delete from #ind where name is null or name = ''

-- count index field
select @ind_cnt = count(*) from #ind

print 'CREATE PROC asp_' + @name + 'Sel'

if @ind_cnt > 0
begin
    print '@option int,'
    select @i = 1
    declare cur_ind1 cursor for
        select name from #ind
    open cur_ind1 
    fetch from cur_ind1 into @fldname
    while @@fetch_status = 0
    begin
	if @i < @ind_cnt
        begin
            select @msg = '@' + @fldname + ' ' + t.name + ( case t.name 
                                                            when 'char'	then ' char(' + convert( varchar(4), c.length ) + ') = null'
                                                            when 'varchar' then  ' varchar(' + convert( varchar(4), c.length ) + ') = null'
                                                            when 'decimal' then  ' decimal(' + ltrim(str(c.prec)) + ',' + ltrim(str(c.scale)) + ') = null'
                                                            when 'numeric' then  ' numeric(' + ltrim(str(c.prec)) + ',' + ltrim(str(c.scale)) + ') = null'
                                                            else ' ' + ' = null'
                                                            end ) + ','
              from syscolumns c, systypes t
             where id = object_id(@name) 
               and c.name = @fldname
               and c.usertype = t.usertype
            print @msg
        end
        else
        begin
            select @msg = '@' + @fldname + ' ' + ( case t.name 
                                                   when 'char'	then ' char(' + convert( varchar(4), c.length ) + ') = null'
                                                   when 'varchar' then  ' varchar(' + convert( varchar(4), c.length ) + ') = null'
                                                   when 'decimal' then  ' decimal(' + ltrim(str(c.prec)) + ',' + ltrim(str(c.scale)) + ') = null'
                                                   when 'numeric' then  ' numeric(' + ltrim(str(c.prec)) + ',' + ltrim(str(c.scale)) + ') = null'
                                                   else ' ' + t.name  + ' = null'
                                                   end )
              from syscolumns c, systypes t
             where id = object_id(@name) 
               and c.name = @fldname
               and c.usertype = t.usertype
            print @msg
        end
	select @i = @i + 1
	fetch from cur_ind1 into @fldname
    end
    deallocate cur_ind1
end
else
begin
    print '@option int'
end
print 'AS'
print ''

print 'IF @option = 1 '
print 'BEGIN'
print '    SELECT'
select @i = 1
select @col_cnt = count(*) from syscolumns where id = object_id(@name)
declare cur_fld1 cursor for
    select c.name 
      from syscolumns c
     where id = object_id(@name) 
     order by c.colid
open cur_fld1 
fetch from cur_fld1 into @msg
while @@fetch_status = 0
begin
    select @msg = '        ' + @msg
    if @i < @col_cnt
        select @msg = @msg + ','

    print @msg
    select @i = @i + 1
    fetch from cur_fld1 into @msg
end
deallocate cur_fld1
select @msg = '    FROM ' + @name
print @msg
print 'END'

print 'ELSE IF @option = 2 '
print 'BEGIN'
print '    SELECT'
select @i = 1
select @col_cnt = count(*) from syscolumns where id = object_id(@name)
declare cur_fld2 cursor for
    select c.name 
      from syscolumns c
     where id = object_id(@name) 
     order by c.colid
open cur_fld2 
fetch from cur_fld2 into @msg
while @@fetch_status = 0
begin
    select @msg = '        ' + @msg
    if @i < @col_cnt
        select @msg = @msg + ','
    print @msg
    select @i = @i + 1
    fetch from cur_fld2 into @msg
end
deallocate cur_fld2
select @msg = '    FROM ' + @name
print @msg
if @ind_cnt > 0
begin
    print '    WHERE'
    select @i = 1
    declare cur_ind2 cursor for
        select name from #ind
    open cur_ind2 
    fetch from cur_ind2 into @fldname
    while @@fetch_status = 0
    begin
	if @i < @ind_cnt
            select @msg = '        ' + @fldname + ' = @' + @fldname + ' AND'
        else
            select @msg = '        ' + @fldname + ' = @' + @fldname
        print @msg
	select @i = @i + 1
	fetch from cur_ind2 into @fldname
    end
    deallocate cur_ind2
end
print 'END'

print 'GO'










GO

