GO




CREATE proc [dbo].[GetAllHardware]
@HardwareTypeGroupID int = null
, @OfficeID int = null
, @HardwareTypeID int = null
, @BeginDate datetime = null
, @EndDate datetime = null
as
Create Table #Tmp(val int)
insert #Tmp
select ha.PriceSetID
	from Hardware ha
			inner join Office ofe on ha.OfficeID = ofe.OfficeID
			inner join HardwareType hat on ha.HardwareTypeID = hat.HardwareTypeID 
	Where (ha.OfficeID = @OfficeID or @OfficeID is null)
		and (ha.HardwareTypeID = @HardwareTypeID or @HardwareTypeID is null)
		and (hat.HardwareTypeGroupID = @HardwareTypeGroupID or @HardwareTypeGroupID is null)
		and (ha.AcquirementDatetime >= @BeginDate or @BeginDate is null)
		and (ha.AcquirementDatetime <= @EndDate or @EndDate is null)

select Sum(val) as SumHardware From #Tmp
drop table #Tmp


GO

