-- ----------------------------
-- Function structure for DecryptPassword
-- ----------------------------
DROP FUNCTION [dbo].[DecryptPassword]
GO



create FUNCTION [dbo].[DecryptPassword](@str varchar(4000))
Returns varchar(4000)
as
begin
	declare @sStr varchar(500)
	declare @sKey int, @sNew varchar(4000)

	select @sKey = Cast(SubString(@str,Len(@str)-3, Len(@str)) as int) + 555
	set @sNew = ''
	set @str = Substring(@str,1,Len(@str)-4)
	Set @str = Replace(@str,'E','3')
	Set @str = Replace(@str,'A','4')
	Set @str = Replace(@str,'O','0')
	While @Str <> ''
	Begin
		set @sNew = @sNew + Char(Cast(Substring(@str,1, 4) as int) - @sKey)
		set @Str = Substring(@Str,5, len(@Str) -1)
	End
	return @sNew
end









GO

-- ----------------------------
-- Function structure for EncryptPassword
-- ----------------------------
DROP FUNCTION [dbo].[EncryptPassword]
GO




create FUNCTION [dbo].[EncryptPassword](@str varchar(4000))
Returns varchar(4000)
as
begin
	declare @sStr varchar(500)
	declare @sKey int, @sNew varchar(4000)

	select @sKey = RandomNumber From RandomNumber
	set @sNew = ''
	While @Str <> ''
	Begin
		set @sStr = Substring(@Str,1, 1)
		set @sStr = Cast(Cast(AscII(@sStr) as int) + @sKey + 10000 as varchar(10))
		set @sStr = Substring(@sStr, 2, len(@sStr) -1)
		set @sNew = @sNew + @sStr
		set @Str = Substring(@Str,2, len(@Str) -1)
	End
	Set @sNew = Replace(@sNew,'3','E')
	Set @sNew = Replace(@sNew,'4','A')
	Set @sNew = Replace(@sNew,'0','O')
	return @sNew + Substring(cast((@sKey - 555 + 10000) as varchar(10)),2,4)
end











GO

